import React from 'react';
import Navbar from './components/common/MyNavbar';
import MainPage from './components/common/MainPage';
import Footer from './components/common/Footer';
import './App.css';

function App() {
  return (
    <div className="App">
      <Navbar />
      <MainPage />
      <Footer />
    </div>
  );
}

export default App;
